let b = parcel.getFeatureById('Ark')
let collide=true
b.set({collidable:true})

feature.on('click',e=>{
  if(collide){
    b.set({collidable:false})
    collide=!collide
  }else{
    b.set({collidable:true})
    collide=!collide
  }

})

let closed = true

feature.on('click',e=>{

  if(closed){
      feature.rotation.y=0
  }else{
      feature.rotation.y=-.57

  }
closed=!closed
})

